import React, { Component, Fragment } from "react";
import { Typography, Button } from "@material-ui/core";
import { Navigate } from "../App";

interface DailyCheckInProps {
    navigate: Navigate;
}

interface DailyCheckInState {
    page: number;
}

export class DailyCheckIn extends Component<
    DailyCheckInProps,
    DailyCheckInState
> {
    constructor(props: DailyCheckInProps) {
        super(props);
        this.state = {
            page: 1
        };
    }

    render() {
        return (
            <Fragment>
                <div
                    style={{
                        display: "flex",
                        flexDirection: "row",
                        justifyContent: "space-between",
                        padding: "2ch"
                    }}
                >
                <Button onClick={() => this.props.navigate("HomeScreen")}>
                    Home
                </Button>
                <p>DailyCheckIn</p>
                </div>
                {this.getContent()}
                <div
                    style={{
                        display: "flex",
                        flexDirection: "row",
                        justifyContent: "space-between",
                        padding: "2ch"
                    }}
                >
                    <Button onClick= {() => this.setState({page:this.state.page - 1})} disabled={this.state.page == 1}>
                        Previous
                    </Button>
                    <Button onClick= {() => this.setState({page:this.state.page + 1})} disabled={this.state.page == 3}>
                        Next
                    </Button>
                </div>
            </Fragment>
        );
    }

    getContent() {
        if (this.state.page === 1) {
            return this.page1();
        } else if (this.state.page === 2) {
            return this.page2();
        }
    }

    page1() {
        return (
            <Fragment>
                <h1>Nutrition</h1>
                <div
                    style={{
                        display: "flex",
                        flexDirection: "column",
                        justifyContent: "space-between",
                        padding: "2ch"
                    }}
                >
                    <div>
                        <p>Water</p>
                    </div>
                    <p>Food</p>
                    <p>Vegetables</p>
                    <p>Grains</p>
                    <p>Protein</p>
                </div>
            </Fragment>
        );
    }

    page2() {
        return <p>2</p>;
    }
}
